<!DOCTYPE html>
<meta charset="utf-8">
<title>Sophia Platform Metrics</title>
<style>
    @import url(http://fonts.googleapis.com/css?family=Yanone+Kaffeesatz:400,700);

    body {
        font-family: "Helvetica Neue";
        color: #1F4057;
        margin: 40px auto;
        width: 960px;
        min-height: 2000px;
    }

    #body {
        position: relative;
    }

    footer {
        padding: 2em 0 1em 0;
        font-size: 12px;
    }

    h1 {
        font-size: 56px;
        margin-top: .3em;
        margin-bottom: 0;
    }

    h1+h2 {
        margin-top: 0;
    }

    h2 {
        font-weight: 400;
        font-size: 28px;
    }

    h1,
    h2 {
        font-family: "Yanone Kaffeesatz";
        text-rendering: optimizeLegibility;
    }

    .chart {
        display: inline-block;
        height: 151px;
        margin-bottom: 20px;
    }

    .reset {
        padding-left: 1em;
        font-size: smaller;
        color: #ccc;
    }

    .background.bar {
        fill: #ccc;
    }

    .foreground.bar {
        fill: steelblue;
    }

    .axis path,
    .axis line {
        fill: none;
        stroke: #000;
        shape-rendering: crispEdges;
    }

    .axis text {
        font: 10px sans-serif;
    }

    .brush rect.extent {
        fill: steelblue;
        fill-opacity: .125;
    }

    .brush .resize path {
        fill: #eee;
        stroke: #666;
    }

    aside {
        position: absolute;
        left: 740px;
        font-size: smaller;
        width: 220px;
    }

    svg {
        border: 1px solid #1F4057;
    }

    text {
        fill: #1F4057;
        font-weight: normal;
        font-size: 0.9em;
        text-anchor: start;
    }

    polyline.link {
        fill: none;
        stroke: #eb2666;
        stroke-opacity: 0.8;
        stroke-linecap: round;
        stroke-width: 1;
        stroke-dasharray: 2 2;
    }

    .bordered {
        fill: white;
        stroke-width: 1;
        stroke: #1F4057;
    }

    .p5 {
        fill: #f03b20;
    }

    .p4 {
        fill: #fd8d3c;
    }

    .p3 {
        fill: #74a9cf;
    }

    .p2 {
        fill: #78c679;
    }

    .p1 {
        fill: #c2e699;
    }
</style>
